const getFontSize = function(welcome) {
    let font;
    if (welcome.length > 17) {
        font = 'font10';
    } else if (welcome.length > 16) {
        font = 'font11';
    } else if (welcome.length > 15) {
        font = 'font12';
    } else if (welcome.length > 14) {
        font = 'font13';
    } else if (welcome.length > 13) {
        font = 'font14';
    } else if (welcome.length > 12) {
        font = 'font15';
    } else {
        font = 'font16';
    }
    return font;
}

